    true,nt"url": null,nt"notes": "<p>The National Plan and Provider Enumeration
    System, NPPES, downloadable file, also referred to as the NPI Downloadable File,
    contains FOIA disclosable NPPES health care provider data for health care providers
    who have been assigned National Provider Identifiers, NPIs. In accordance with the
    NPPES Data Dissemination Notice, each month CMS will create a single zipped file
    that will contain 1. a data file containing all of the FOIA disclosable health care
    provider data in NPPES as of a certain date in the month, 2. a Read Me File describing
    the information in the data file, 3. a Header File containing the format of the
    data file, and 4. a Code Values document listing the descriptions for all of the
    codes found in the data file. Each month, CMS replaces the previous months file,
    only one file is available for downloading at any given time.</p>n",nt"license_title":
